    s = "t142 t57 t31 t112 t131 t50"

    def is_valid(grammar, string):
        """Checks if a string is valid according to the given grammar."""
        stack = []
        for char in string:
            if char in grammar.S:
                stack.append(char)
            elif char in grammar.NT:
                if not stack:
                    return False
                top = stack.pop()
                if grammar.S.find(top) != -1:
                    return False
        return not stack

